module.exports = "<div class=\"row blog-pic\">  \n</div>\n\n<div class=\"container\">\n\n  <div class=\"row\">\n     <h1 style=\"font-size:50px;font-weight:600;\">Why Career Counselling In India Is More Valuable Now Than Ever Before?</h1>\n  </div>\n\n  <div class=\"row\">\n\n     <div class=\"col-md-8\">\n\n        <div class=\"row\">\n          <div class=\"col-md-3\"><p style=\"font-size:14px;font-weight:800;\">JEFFEREY ZACK |</p></div>\n          <div class=\"col-md-4\" style=\"margin-right:0px;\"><p style=\"font-size:14px;font-weight:500;\">August 05,2015 at 10:40 |</p></div>\n          <div class=\"col-md-1\"><p style=\"font-size:15px;color:blue;font-weight:600;\">Founding</p></div>\n          <div class=\"col-md-4\"></div>\n        </div>\n\n        <div class=\"row content-pic\">\n\n        </div>\n\n        <div class=\"row\" style=\"margin-top:25px;margin-bottom:25px;\">\n           <div class=\"col-md-3 social-div\"><a href=\"https://www.facebook.com/company/careernaksha\" class=\"social-link\"><button style=\"background-color: #3b5998;\" class=\"social-button\"><i class=\"fab fa-facebook-f\"></i> FACEBOOK</button></a></div>\n           <div class=\"col-md-3 social-div\" ><a href=\"https://www.twitter.com/company/careernaksha\" class=\"social-link\"><button style=\"background-color:  #00aced;\" class=\"social-button\"><i class=\"fab fa-twitter\"></i> TWITTER</button></a></div>\n           <div class=\"col-md-3 social-div\"><a href=\"https://plus.google.com/107779926432532044968\" class=\"social-link\"><button style=\"background-color:#DB4437;\" class=\"social-button\"><i class=\"fab fa-google-plus-g\"></i> GOOGLE +</button></a></div>\n           <div class=\"col-md-1\" style=\"background-color:lightgrey;font-size:16px;\">. . .</div>\n           <div class=\"col-md-2\"></div>\n        </div>\n\n        <div class=\"row\">\n\n       <p style=\"font-size:17px;font-weight:500;color:rgb(0,167,157);\"></p>\n       <p style=\"font-size:17px;color:rgb(0,167,157);font-weight:600;\">Well begun is half done. This proverb explains the essence of career\n        counselling to a greater extent. If one chooses the right field in career, it\n        pays in the long run. Career planning begins right from childhood and\n        continues for the lifetime. Career planning is the result of many factors\n        comprising capabilities, education, mindset and personality. Career\n        counselling is the field of expertise which helps the students to choose the\n        right field for education or profession. It has gained immense popularity in\n        India with an increased competition in the market lately which itself depicts\n        the story.\n        The world of work is changing continuously and rapidly. The career\n        opportunities which are prevalent these days were not in existence five or\n        ten years ago. As there are new inventions and discoveries, the work\n        environment is changing accordingly. So, one cant stick to a particular\n        career for a lifetime. With the boom in career opportunities, students often\n        get confused with the right choice of career.</p>\n       <p style=\"font-size:17px;color:rgb(0,167,157);font-weight:600;\">Reasons behind why career counselling in India is more valuable now\n        than ever before are as follows:</p>\n        </div>\n\n\n      \n\n        <div class=\"row\" *ngIf=\"showmore\">\n\n          <p style=\"font-size:17px;font-weight:500;color:rgb(0,167,157);\"></p>\n          <p style=\"font-size:17px;color:rgb(0,167,157);font-weight:600;\">1) Career counselling is a boon for those who are not aware of the\n            latest trends- In India, parents still like to decide the career options\n            for their children based on traditional courses. Also, they think that if\n            they couldnt fulfil their dreams, then their son/daughter should grab\n            that career opportunity. And even children are not much aware of the\n            courses/colleges available in trend. Career counsellors are the\n            experts who help students or professionals to find realistic positions\n            based on their skills, interests, experience etc. They explore all the\n            available options. If there are any options available and you are\n            interested yet not qualified for that, then the counsellors will set the\n            correct path to acquire the knowledge for the same.\n            <br>\n            <br>\n            2) A book should not be judged by its cover- Choosing a career is\n            seen as a way to integrate into society whether as a doctor, as a\n            teacher and also as a social welfare-oriented employee like career\n            counsellor. Career counsellors try to find a persons original pain.\n            This pain lays the background for a persons career. Career\n            counsellors help to combat this pain and enable the person to use\n            this pain as a strength and build a career to prove oneself. The more\n            pain a person goes through in life, the more willing he is to prove\n            himself. Once a student/youngster is determinant, he is motivated to\n            work very hard to achieve his goals.\n            <br>\n            <br>\n            3) Career counsellors help in dealing with career crossroads-\n            Youngsters consult career counsellors when they have natural\n            crossroads like choosing a field of study, a school, a university or a\n            wide range of employment opportunities. Then, the second\n            crossroads which youngsters face is when they have doubts about\n            whether they have made the right choice in terms of schools,\n            universities, careers or employers. It can be a long and confusing\n            task for the students to find an ideal career. Sometimes, the individual\n            may feel that a specific job is suitable for him. But it may turn up as\n            the biggest hurdle in his career and personal growth. Thats why it is\n            important to utilize the skills of an experienced and well-informed\n            counsellor who can help to locate and land up with that one perfect\n            job.\n            <br>\n            <br>\n            4) Adaptation to the changing work environment- In the present\n            scenario, especially in India, the job market is facing a lot of\n            competition. The versatility of profession in India requires multi-skilled\n            individuals. Career counsellors help the individuals to select and learn\n            different skills viz. skill management techniques. They assist students\n            in their career growth through well-proved modern techniques. Also,\n            employees are being confronted continuously with the impact of the\n            changes in the workplace. They have to deal with the crossroads\n            frequently. They are uncertain whether they will be able to deal with\n            the changes. Career counsellors encourage them to deal with these\n            kinds of situation.\n            <br>\n            <br>\n            5) Right career/employment opportunities for the right candidate-\n            Right career/employment opportunities for the right candidate is the\n            need of the hour. A majority of youngsters are not able to use their\n            skills in building their career because of wrong career choice. This\n            hampers the growth of the candidate as well as the company. You\n            can find the right career, but there is a need to have a deep\n            knowledge of courses to be chosen so that your capabilities match\n            with your interests. There are possibilities that you might be wanting\n            to pursue a career which may prove to be a debacle in your career\n            graph. Career counselling in India ensures the right guidance to\n            overcome any diversion or ambiguity. Also, career counsellors\n            prevent students from making a wrong career choice. Career\n            counsellors ensure that students have the clarity of thought. They\n            make themselves available for students anytime on call/online/in\n            person.</p>\n         \n           </div>\n   \n\n\n\n\n      \n        <div style=\"text-align:center;width:100%;height:50px;margin-top:15px;\n        margin-bottom:25px;\">\n          <button *ngIf=\"showbutton\" class=\"read-btn\" (click)=\"showMore()\">READ MORE</button>\n        </div>\n\n\n\n\n\n     </div>\n\n\n     <div class=\"col-md-4\"></div>\n  \n\n  </div>\n \n</div> "

